import React from 'react';
import styled from 'styled-components';
import { HeadText } from './Calender';
import { imgData } from '../assets/imgData';
import { arrowLeft } from '../assets/icon-arrow-left.svg';
import { arrowRight } from '../assets/icon-arrow-right.svg';

export default function Gallery() {
  return (
    <div>
      <HeadText>갤러리</HeadText>
      <GalleryWrapper>
        <ArrowLeftButton src={arrowLeft} />
        {imgData.map((img, i) => (
          <GalleryImg key={i} src={img.src} alt={img.alt} />
        ))}
        <ArrowRightButton src={arrowRight} />
      </GalleryWrapper>
    </div>
  );
}

export const GalleryWrapper = styled.div``;

export const GalleryImg = styled.div`
  width: 100%;
  max-width: 400px;
  aspect-ratio: 1 / 2;
  background-image: url(${(props) => props.src});
  background-size: cover;
  background-position: center center;
  background-repeat: no-repeat;
`;

export const ArrowLeftButton = styled.button``;
